import React from "react";
import s from './Dialogs.module.css';


function Message(props) {
    return (
        <div className={s.messages}>
            {props.message}
        </div>
    )
}

function Dialogs() {
    let dialogs_data = [
        {id: 1, name: "Yaroslav"},
        {id: 2, name: "Alex"},
        {id: 3, name: "Veronika"},
        {id: 4, name: "Naruto"},
        {id: 5, name: "Tanjiro"},
        {id: 6, name: "Kaneki"},
    ];
    let messages_data = [
        {id: 1, message: "heyy"},
        {id: 2, message: "no"},
        {id: 3, message: "ok"},
        {id: 4, message: "the let's go"},
        {id: 5, message: "yeah that's great"},
        {id: 6, message: "welcome amazing"},
    ]
    let dialogs_elements = dialogs_data.map
    (dialog => <Dialog_item id={dialog.id} name={dialog.name}/>);
    let messages_elements = messages_data.map
    (m => <Message message={m.message}/>);

    return (
        <div className={s.content}>
            <div className={s.dialogs}>
                <h1>Dialogs</h1>
                {dialogs_elements}
            </div>
            <div>
                {messages_elements}
            </div>
        </div>
    )
}

export default Dialogs;
